import React from 'react';
import logo from './logo.svg';
import './App.css';
import NavBar from './components/NavBar'
import SeccionForm from './components/SeccionForm'
import './css/optimizacion.css'
import 'bootstrap/dist/css/bootstrap.css';

function App() {
  return (
    <div className="App">
      <NavBar />
      <div className = 'container'>
        <div class="jumbotron jumbotron-fluid">
          <div class="container">
            <h1 class="display-4"><i class="fas fa-code"></i> Optimización lineal</h1>
            <p class="lead">Optimización de la producción semanal de helados.</p>
          </div>
        </div>
        <SeccionForm />
      </div>
    </div>
  );
}

export default App;
